function baseStyle(props) {
  const {
    orientation,
    thickness
  } = props;
  const orientationProps = orientation === 'vertical' ? {
    width: "".concat(thickness, "px"),
    // handle for web : To be discussed
    height: '100%'
  } : {
    width: '100%',
    height: "".concat(thickness, "px")
  };
  return {
    _light: {
      bg: 'muted.300'
    },
    _dark: {
      bg: 'muted.600'
    },
    ...orientationProps
  };
}

export default {
  baseStyle,
  defaultProps: {
    orientation: 'horizontal',
    thickness: '1'
  }
};
